  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset consists of video transect
  images (TIF files) from CRAMP surveys taken in 2002 at 23 sites, some of which had
  multiple depths. Estimates of substrate type, rugosity, species type, and percent
  coverage will be provided to the NOAA data system within a separate data set. The
  video images are important for future researchers to resolve any question about
  how the image data were interpreted for the quantitative database, to provide the
  opportunity to re-analyze the images using other methods, and to return to the same
  locations for future comparisons.\",\n\t\"license_title\": null,\n\t\"extras\":
